from typing import List

class Solution:
    def help(self, M, n, m, i, j, diri, dirj):
        if (i, j, diri, dirj) in self.done:
            return self.done[(i, j, diri, dirj)]
        if i < 0 or i >= n or j < 0 or j >= m or M[i][j] == 0:
            return 0
        else:

            maxi = 0
            if diri == 0 and dirj == 0:
                maxi = max(maxi, self.help(M, n, m, i+1, j + 1, 1, 1) + self.help(M, n, m, i-1, j - 1, -1, -1) + 1)
                maxi = max(maxi, self.help(M, n, m, i-1, j + 1, -1, 1) + self.help(M, n, m, i+1, j - 1, 1, -1) + 1)
                maxi = max(maxi, self.help(M, n, m, i, j + 1, 0, 1) + self.help(M, n, m, i, j - 1, 0, -1) + 1)
                maxi = max(maxi, self.help(M, n, m, i-1, j, -1, 0) + self.help(M, n, m, i+1, j, 1, 0) + 1)
                return maxi
            elif diri == 1 and dirj == 1:
                maxi =  1 + self.help(M, n, m, i+1, j + 1, 1, 1)

            elif diri == -1 and dirj == -1:
                maxi =  1 + self.help(M, n, m, i-1, j - 1, -1, -1)
            elif diri == -1 and dirj == 1:
                maxi =  1 + self.help(M, n, m, i-1, j + 1, -1, 1)
            elif diri == 1 and dirj == -1:
                maxi =  1 + self.help(M, n, m, i+1, j - 1, 1, -1)
            elif diri == 0 and dirj == 1:
                maxi =  1 + self.help(M, n, m, i, j + 1, 0, 1)
            elif diri == 0 and dirj == -1:
                maxi =  1 + self.help(M, n, m, i, j - 1, 0, -1)
            elif diri == -1 and dirj == 0:
                maxi =  1 + self.help(M, n, m, i-1, j, -1, 0)
            elif diri == 1 and dirj == 0:
                maxi =  1 + self.help(M, n, m, i+1, j, 1, 0)
            self.done[(i, j, diri, dirj)] = maxi
            return maxi




    def longestLine(self, M: List[List[int]]) -> int:
        n = len(M)
        if n == 0:
            return 0
        m = len(M[0])
        if m == 0:
            return 0
        maxi = 0
        self.done = {}
        for i in range(n):
            for j in range(m):
                if M[i][j] == 1:
                    maxi = max(maxi, self.help(M, n, m , i, j, 0, 0))
        return maxi


